import React from 'react';
import ReactDOM from 'react-dom';
import GlobalStyle from './styles/global';
import Routering from './Routes/routes';

// Importe createRoot do pacote react-dom/client
import { createRoot } from 'react-dom/client';

const Login = () => {
  return (
    <React.StrictMode>
      <GlobalStyle/>
      <Routering />
    </React.StrictMode>
  );
}

// Verifique se createRoot já foi chamado antes de chamar novamente
const existingRoot = ReactDOM.unstable_createRoot(document.getElementById('root'));
const root = existingRoot._root;
if (!root) {
  // Se não houver root existente, crie um novo
  const newRoot = createRoot(document.getElementById('root'));
  newRoot.render(<Login />);
} else {
  // Se houver um root existente, atualize o conteúdo
  root.render(<Login />);
}

export default Login;
